import React from "react";
import Notes from "./Note";
import noteDetails from "./noteDetails";

function Note() {
  return (
    <div className="note">
      {Notes.map((noteElements) => (
        <noteDetails
          nTitle={noteElements.title}
          nContent={noteElements.content}
        />
      ))}
    </div>
  );
}

export default Note;
